import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import { makeStyles } from '@material-ui/core/styles';

const Header = (props) => {

  <div className="root">
    <AppBar
      title={<img src={props.image} />}
    />
  </div>

}


export default Header;
